// @Description: Used to convert the voltage of the voltage sensing pin (@PREFIX@VOLT_PIN) to the actual battery's voltage (pin_voltage * VOLT_MULT). For the 3DR Power brick with a Pixhawk, this should be set to 10.1. For the Pixhawk with the 3DR 4in1 ESC this should be 12.02. For the PX using the PX4IO power supply this should be set to 1.
// @User: Advanced

BATT_VOLT_PIN.__field_text:
// @DisplayName: Battery Voltage sensing pin
// @Description: Sets the analog input pin that should be used for voltage monitoring.
// @Values: -1:Disabled, 2:Pixhawk/Pixracer/Navio2/Pixhawk2_PM1, 5:Navigator, 13:Pixhawk2_PM2/CubeOrange_PM2, 14:CubeOrange, 16:Durandal, 100:PX4-v1
// @User: Standard
// @RebootRequired: True

BATT_WATT_MAX.__field_text:
// @DisplayName: Maximum allowed power (Watts)
// @Description: If battery wattage (voltage * current) exceeds this value then the system will reduce max throttle (THR_MAX, TKOFF_THR_MAX and THR_MIN for reverse thrust) to satisfy this limit. This helps limit high current to low C rated batteries regardless of battery voltage. The max throttle will slowly grow back to THR_MAX (or TKOFF_THR_MAX ) and THR_MIN if demanding the current max and under the watt max. Use 0 to disable.
// @Units: W
// @Increment: 1
// @User: Advanced

BRD_ALT_CONFIG.__field_text:
// @DisplayName: Alternative HW config
// @Description: Select an alternative hardware configuration. A value of zero selects the default configuration for this board. Other values are board specific. Please see the documentation for your board for details on any alternative configuration values that may be available.
// @Range: 0 10
// @Increment: 1
// @User: Advanced
// @RebootRequired: True

BRD_BOOT_DELAY.__field_text:
// @DisplayName: Boot delay
// @Description: This adds a delay in milliseconds to boot to ensure peripherals initialise fully
// @Range: 0 10000
// @Units: ms
// @User: Advanced

BRD_HEAT_I.__field_text:
// @DisplayName: Board Heater I gain
// @Description: Board Heater integrator gain
// @Range: 0 1
// @Increment: 0.1
// @User: Advanced

BRD_HEAT_IMAX.__field_text:
// @DisplayName: Board Heater IMAX
// @Description: Board Heater integrator maximum
// @Range: 0 100
// @Increment: 1
// @User: Advanced

BRD_HEAT_LOWMGN.__field_text:
// @DisplayName: Board heater temp lower margin
// @Description: Arming check will fail if temp is lower than this margin below BRD_HEAT_TARG. 0 disables the low temperature check
// @Range: 0 20
// @Units: degC
// @User: Advanced

BRD_HEAT_P.__field_text:
// @DisplayName: Board Heater P gain
// @Description: Board Heater P gain
// @Range: 1 500
// @Increment: 1
// @User: Advanced

BRD_HEAT_TARG.__field_text:
// @DisplayName: Board heater temperature target
// @Description: Board heater target temperature for boards with controllable heating units. Set to -1 to disable the heater, please reboot after setting to -1.
// @Range: -1 80
// @Units: degC
// @User: Advanced

BRD_IO_DSHOT.__field_text:
// @DisplayName: Load DShot FW on IO
// @Description: This loads the DShot firmware on the IO co-processor
// @Values: 0:StandardFW,1:DshotFW
// @RebootRequired: True
// @User: Advanced

BRD_IO_ENABLE.__field_text:
// @DisplayName: Enable IO co-processor
// @Description: This allows for the IO co-processor on boards with an IOMCU to be disabled. Setting to 2 will enable the IOMCU but not attempt to update firmware on startup
// @Values: 0:Disabled,1:Enabled,2:EnableNoFWUpdate
// @RebootRequired: True
// @User: Advanced

BRD_OPTIONS.__field_text:
// @DisplayName: Board options
// @Description: Board specific option flags
// @Bitmask: 0:Enable hardware watchdog, 1:Disable MAVftp, 2:Enable set of internal parameters, 3:Enable Debug Pins, 4:Unlock flash on reboot, 5:Write protect firmware flash on reboot, 6:Write protect bootloader flash on reboot, 7:Skip board validation
// @User: Advanced

BRD_PWM_VOLT_SEL.__field_text:
// @DisplayName: Set PWM Out Voltage
// @Description: This sets the voltage max for PWM output pulses. 0 for 3.3V and 1 for 5V output. On boards with an IOMCU that support this parameter this option only affects the 8 main outputs, not the 6 auxilliary outputs. Using 5V output can help to reduce the impact of ESC noise interference corrupting signals to the ESCs.
// @Values: 0:3.3V,1:5V
// @User: Advanced

BRD_SAFETYOPTION.__field_text:
// @DisplayName: Options for safety button behavior
// @Description: This controls the activation of the safety button. It allows you to control if the safety button can be used for safety enable and/or disable, and whether the button is only active when disarmed
// @Bitmask: 0:ActiveForSafetyDisable,1:ActiveForSafetyEnable,2:ActiveWhenArmed,3:Force safety on when the aircraft disarms
// @User: Standard

BRD_SAFETY_DEFLT.__field_text:
// @DisplayName: Sets default state of the safety switch
// @Description: This controls the default state of the safety switch at startup. When set to 1 the safety switch will start in the safe state (flashing) at boot. When set to zero the safety switch will start in the unsafe state (solid) at startup. Note that if a safety switch is fitted the user can still control the safety state after startup using the switch. The safety state can also be controlled in software using a MAVLink message.
// @Values: 0:Disabled,1:Enabled
// @RebootRequired: True
// @User: Standard

BRD_SAFETY_MASK.__field_text:
// @DisplayName: Outputs which ignore the safety switch state
// @Description: A bitmask which controls what outputs can move while the safety switch has not been pressed
// @Bitmask: 0:Output1,1:Output2,2:Output3,3:Output4,4:Output5,5:Output6,6:Output7,7:Output8,8:Output9,9:Output10,10:Output11,11:Output12,12:Output13,13:Output14
// @RebootRequired: True
// @User: Advanced

BRD_SBUS_OUT.__field_text:
// @DisplayName:  SBUS output rate
// @Description: This sets the SBUS output frame rate in Hz
// @Values: 0:Disabled,1:50Hz,2:75Hz,3:100Hz,4:150Hz,5:200Hz,6:250Hz,7:300Hz
// @RebootRequired: True
// @User: Advanced

BRD_SD_MISSION.__field_text:
// @DisplayName:  SDCard Mission size
// @Description: This sets the amount of storage in kilobytes reserved on the microsd card in mission.stg for waypoint storage. Each waypoint uses 15 bytes.
// @Range: 0 64
// @RebootRequired: True
// @User: Advanced

BRD_SD_SLOWDOWN.__field_text:
// @DisplayName: microSD slowdown
// @Description: This is a scaling factor to slow down microSD operation. It can be used on flight board and microSD card combinations where full speed is not reliable. For normal full speed operation a value of 0 should be used.
// @Range: 0 32
// @Increment: 1
// @User: Advanced

BRD_SER1_RTSCTS.__field_text:
// @DisplayName: Serial 1 flow control
// @Description: Enable flow control on serial 1 (telemetry 1). You must have the RTS and CTS pins connected to your radio. The standard DF13 6 pin connector for a 3DR radio does have those pins connected. If this is set to 2 then flow control will be auto-detected by checking for the output buffer filling on startup. Note that the PX4v1 does not have hardware flow control pins on this port, so you should leave this disabled.
// @Values: 0:Disabled,1:Enabled,2:Auto
// @RebootRequired: True
// @User: Advanced

BRD_SER2_RTSCTS.__field_text:
// @DisplayName: Serial 2 flow control
// @Description: Enable flow control on serial 2 (telemetry 2). You must have the RTS and CTS pins connected to your radio. The standard DF13 6 pin connector for a 3DR radio does have those pins connected. If this is set to 2 then flow control will be auto-detected by checking for the output buffer filling on startup.
// @Values: 0:Disabled,1:Enabled,2:Auto
// @RebootRequired: True
// @User: Advanced

BRD_SER3_RTSCTS.__field_text:
// @DisplayName: Serial 3 flow control
// @Description: Enable flow control on serial 3. You must have the RTS and CTS pins connected to your radio. The standard DF13 6 pin connector for a 3DR radio does have those pins connected. If this is set to 2 then flow control will be auto-detected by checking for the output buffer filling on startup.
// @Values: 0:Disabled,1:Enabled,2:Auto
// @RebootRequired: True
// @User: Advanced

BRD_SER4_RTSCTS.__field_text:
// @DisplayName: Serial 4 flow control
// @Description: Enable flow control on serial 4. You must have the RTS and CTS pins connected to your radio. The standard DF13 6 pin connector for a 3DR radio does have those pins connected. If this is set to 2 then flow control will be auto-detected by checking for the output buffer filling on startup.
// @Values: 0:Disabled,1:Enabled,2:Auto
// @RebootRequired: True
// @User: Advanced

BRD_SER5_RTSCTS.__field_text:
// @DisplayName: Serial 5 flow control
// @Description: Enable flow control on serial 5. You must have the RTS and CTS pins connected to your radio. The standard DF13 6 pin connector for a 3DR radio does have those pins connected. If this is set to 2 then flow control will be auto-detected by checking for the output buffer filling on startup.
// @Values: 0:Disabled,1:Enabled,2:Auto
// @RebootRequired: True
// @User: Advanced

BRD_SERIAL_NUM.__field_text:
// @DisplayName: User-defined serial number
// @Description: User-defined serial number of this vehicle, it can be any arbitrary number you want and has no effect on the autopilot
// @Range: -8388608 8388607
// @User: Standard

BRD_TYPE.__field_text:
// @DisplayName: Board type
// @Description: This allows selection of a PX4 or VRBRAIN board type. If set to zero then the board type is auto-detected (PX4)
// @Values: 0:AUTO,1:PX4V1,2:Pixhawk,3:Cube/Pixhawk2,4:Pixracer,5:PixhawkMini,6:Pixhawk2Slim,13:Intel Aero FC,14:Pixhawk Pro,20:AUAV2.1,21:PCNC1,22:MINDPXV2,23:SP01,24:CUAVv5/FMUV5,30:VRX BRAIN51,32:VRX BRAIN52,33:VRX BRAIN52E,34:VRX UBRAIN51,35:VRX UBRAIN52,36:VRX CORE10,38:VRX BRAIN54,39:PX4 FMUV6,100:PX4 OLDDRIVERS
// @RebootRequired: True
// @User: Advanced

BRD_VBUS_MIN.__field_text:
// @DisplayName: Autopilot board voltage requirement
// @Description: Minimum voltage on the autopilot power rail to allow the aircraft to arm. 0 to disable the check.
// @Units: V
// @Range: 4.0 5.5
// @Increment: 0.1
// @User: Advanced

BRD_VSERVO_MIN.__field_text:
// @DisplayName: Servo voltage requirement
// @Description: Minimum voltage on the servo rail to allow the aircraft to arm. 0 to disable the check.
// @Units: V
// @Range: 3.3 12.0
// @Increment: 0.1
// @User: Advanced

BRD_RADIO_ABLVL.__field_text:
// @DisplayName: Auto-bind level
// @Description: This sets the minimum RSSI of an auto-bind packet for it to be accepted. This should be set so that auto-bind will only happen at short range to minimise the change of an auto-bind happening accidentially
// @Range: 0 31
// @User: Advanced

BRD_RADIO_ABTIME.__field_text:
// @DisplayName: Auto-bind time
// @Description: When non-zero this sets the time with no transmitter packets before we start looking for auto-bind packets.
// @Range: 0 120
// @User: Advanced

BRD_RADIO_BZOFS.__field_text:
// @DisplayName: Transmitter buzzer adjustment
// @Description: Set transmitter buzzer note adjustment (adjust frequency up)
// @Range: 0 40
// @User: Advanced

BRD_RADIO_DEBUG.__field_text:
// @DisplayName: debug level
// @Description: radio debug level
// @Range: 0 4
// @User: Advanced

BRD_RADIO_DISCRC.__field_text:
// @DisplayName: disable receive CRC
// @Description: disable receive CRC (for debug)
// @Values: 0:NotDisabled,1:Disabled
// @User: Advanced

BRD_RADIO_FCCTST.__field_text:
// @DisplayName: Put radio into FCC test mode
// @Description: If this is enabled then the radio will continuously transmit as required for FCC testing. The transmit channel is set by the value of the parameter. The radio will not work for RC input while this is enabled
// @Values: 0:Disabled,1:MinChannel,2:MidChannel,3:MaxChannel,4:MinChannelCW,5:MidChannelCW,6:MaxChannelCW
// @User: Advanced

BRD_RADIO_PPSCH.__field_text:
// @DisplayName: Packet rate channel
// @Description: Channel to show received packet-per-second rate, or zero for disabled
// @Range: 0 16
// @User: Advanced

BRD_RADIO_SIGCH.__field_text:
// @DisplayName: RSSI signal strength
// @Description: Channel to show receive RSSI signal strength, or zero for disabled
// @Range: 0 16
// @User: Advanced

BRD_RADIO_STKMD.__field_text:
// @DisplayName: Stick input mode
// @Description: This selects between different stick input modes. The default is mode2, which has throttle on the left stick and pitch on the right stick. You can instead set mode1, which has throttle on the right stick and pitch on the left stick.
// @Values: 1:Mode1,2:Mode2
// @User: Advanced

BRD_RADIO_TELEM.__field_text:
// @DisplayName: Enable telemetry
// @Description: If this is non-zero then telemetry packets will be sent over DSM
// @Values: 0:Disabled,1:Enabled
// @User: Advanced

BRD_RADIO_TESTCH.__field_text:
// @DisplayName: Set radio to factory test channel
// @Description: This sets the radio to a fixed test channel for factory testing. Using a fixed channel avoids the need for binding in factory testing.
// @Values: 0:Disabled,1:TestChan1,2:TestChan2,3:TestChan3,4:TestChan4,5:TestChan5,6:TestChan6,7:TestChan7,8:TestChan8
// @User: Advanced

BRD_RADIO_TPPSCH.__field_text:
// @DisplayName: Telemetry PPS channel
// @Description: Channel to show telemetry packets-per-second value, as received at TX
// @Range: 0 16
// @User: Advanced

BRD_RADIO_TSIGCH.__field_text:
// @DisplayName: RSSI value channel for telemetry data on transmitter
// @Description: Channel to show telemetry RSSI value as received by TX
// @Range: 0 16
// @User: Advanced

BRD_RADIO_TXMAX.__field_text:
// @DisplayName: Transmitter transmit power
// @Description: Set transmitter maximum transmit power (from 1 to 8)
// @Range: 1 8
// @User: Advanced

BRD_RADIO_TXPOW.__field_text:
// @DisplayName: Telemetry Transmit power
// @Description: Set telemetry transmit power. This is the power level (from 1 to 8) for telemetry packets sent from the RX to the TX
// @Range: 1 8
// @User: Advanced

BRD_RADIO_TYPE.__field_text:
// @DisplayName: Set type of direct attached radio
// @Description: This enables support for direct attached radio receivers
// @Values: 0:None,1:CYRF6936,2:CC2500,3:BK2425

BRD_RTC_TYPES.__field_text:
// @DisplayName: Allowed sources of RTC time
// @Description: Specifies which sources of UTC time will be accepted
// @Bitmask: 0:GPS,1:MAVLINK_SYSTEM_TIME,2:HW
// @User: Advanced

BRD_RTC_TZ_MIN.__field_text:
// @DisplayName: Timezone offset from UTC
// @Description: Adds offset in +- minutes from UTC to calculate local time
// @Range: -720 +840
// @User: Advanced

BTN_ENABLE.__field_text:
// @DisplayName: Enable button reporting
// @Description: This enables the button checking module. When this is disabled the parameters for setting button inputs are not visible
// @Values: 0:Disabled, 1:Enabled
// @User: Advanced

BTN_FUNC1.__field_text:
// @CopyFieldsFrom: RC1_OPTION
// @DisplayName: Button Pin 1 RC Channel function
// @Description: Auxiliary RC Options function executed on pin change
// @User: Standard

BTN_OPTIONS1.__field_text:
// @DisplayName: Button Pin 1 Options
// @Description: Options for Pin 1. PWM input detects PWM above or below 1800/1200us instead of logic level. If PWM is not detected or is less than 800us or above 2200us the button will interpreted as low. Invert changes HIGH state to be logic low voltage on pin, or below 1200us, if PWM input.
// @User: Standard
// @Bitmask: 0:PWM Input,1:InvertInput

BTN_OPTIONS2.__field_text:
// @DisplayName: Button Pin 2 Options
// @Description: Options for Pin 2. PWM input detects PWM above or below 1800/1200us instead of logic level. If PWM is not detected or is less than 800us or above 2200us the button will interpreted as low. Invert changes HIGH state to be logic low voltage on pin, or below 1200us, if PWM input.
// @User: Standard
// @Bitmask: 0:PWM Input,1:InvertInput

BTN_OPTIONS3.__field_text:
// @DisplayName: Button Pin 3 Options
// @Description: Options for Pin 3. PWM input detects PWM above or below 1800/1200us instead of logic level. If PWM is not detected or is less than 800us or above 2200us the button will interpreted as low. Invert changes HIGH state to be logic low voltage on pin, or below 1200us, if PWM input.
// @Bitmask: 0:PWM Input,1:InvertInput

BTN_OPTIONS4.__field_text:
// @DisplayName: Button Pin 4 Options
// @Description: Options for Pin 4. PWM input detects PWM above or below 1800/1200us instead of logic level. If PWM is not detected or is less than 800us or above 2200us the button will interpreted as low. Invert changes HIGH state to be logic low voltage on pin, or below 1200us, if PWM input.
// @User: Standard
// @Bitmask: 0:PWM Input,1:InvertInput

BTN_PIN1.__field_text:
// @DisplayName: First button Pin
// @Description: Digital pin number for first button input.  Some common values are given, but see the Wiki's "GPIOs" page for how to determine the pin number for a given autopilot.
// @User: Standard
// @Values: -1:Disabled,50:AUXOUT1,51:AUXOUT2,52:AUXOUT3,53:AUXOUT4,54:AUXOUT5,55:AUXOUT6

BTN_PIN2.__field_text:
// @DisplayName: Second button Pin
// @Description: Digital pin number for second button input.  Some common values are given, but see the Wiki's "GPIOs" page for how to determine the pin number for a given autopilot.
// @User: Standard
// @Values: -1:Disabled,50:AUXOUT1,51:AUXOUT2,52:AUXOUT3,53:AUXOUT4,54:AUXOUT5,55:AUXOUT6

BTN_PIN3.__field_text:
// @DisplayName: Third button Pin
// @Description: Digital pin number for third button input.  Some common values are given, but see the Wiki's "GPIOs" page for how to determine the pin number for a given autopilot.
// @User: Standard
// @Values: -1:Disabled,50:AUXOUT1,51:AUXOUT2,52:AUXOUT3,53:AUXOUT4,54:AUXOUT5,55:AUXOUT6

BTN_PIN4.__field_text:
// @DisplayName: Fourth button Pin
// @Description: Digital pin number for fourth button input. Some common values are given, but see the Wiki's "GPIOs" page for how to determine the pin number for a given autopilot.
// @User: Standard
// @Values: -1:Disabled,50:AUXOUT1,51:AUXOUT2,52:AUXOUT3,53:AUXOUT4,54:AUXOUT5,55:AUXOUT6

BTN_REPORT_SEND.__field_text:
// @DisplayName: Report send time
// @Description: The duration in seconds that a BUTTON_CHANGE report is repeatedly sent to the GCS regarding a button changing state. Note that the BUTTON_CHANGE message is MAVLink2 only.
// @User: Standard
// @Range: 0 3600

CAM_AUTO_ONLY.__field_text:
// @DisplayName: Distance-trigging in AUTO mode only
// @Description: When enabled, trigging by distance is done in AUTO mode only.
// @Values: 0:Always,1:Only when in AUTO
// @User: Standard

CAM_MAX_ROLL.__field_text:
// @DisplayName: Maximum photo roll angle.
// @Description: Postpone shooting if roll is greater than limit. (0=Disable, will shoot regardless of roll).
// @User: Standard
// @Units: deg
// @Range: 0 180

CAM1_DURATION.__field_text:
// @DisplayName: Camera shutter duration held open
// @Description: Duration in seconds that the camera shutter is held open
// @Units: s
// @Range: 0 5
// @User: Standard

CAM1_FEEDBAK_PIN.__field_text:
// @DisplayName: Camera feedback pin
// @Description: pin number to use for save accurate camera feedback messages. If set to -1 then don't use a pin flag for this, otherwise this is a pin number which if held high after a picture trigger order, will save camera messages when camera really takes a picture. A universal camera hot shoe is needed. The pin should be held high for at least 2 milliseconds for reliable trigger detection.  Some common values are given, but see the Wiki's "GPIOs" page for how to determine the pin number for a given autopilot. See also the CAMx_FEEDBCK_POL option.
// @Values: -1:Disabled,50:AUX1,51:AUX2,52:AUX3,53:AUX4,54:AUX5,55:AUX6
// @User: Standard
// @RebootRequired: True

CAM1_FEEDBAK_POL.__field_text:
// @DisplayName: Camera feedback pin polarity
// @Description: Polarity for feedback pin. If this is 1 then the feedback pin should go high on trigger. If set to 0 then it should go low
// @Values: 0:TriggerLow,1:TriggerHigh
// @User: Standard

CAM1_INTRVAL_MIN.__field_text:
// @DisplayName: Camera minimum time interval between photos
// @Description: Postpone shooting if previous picture was taken less than this many seconds ago
// @Units: s
// @Range: 0 10
// @User: Standard

CAM1_MNT_INST.__field_text:
// @DisplayName: Camera Mount instance
// @Description: Mount instance camera is associated with. 0 means camera and mount have identical instance numbers e.g. camera1 and mount1
// @User: Standard

CAM1_OPTIONS.__field_text:
// @DisplayName: Camera options
// @Description: Camera options bitmask
// @Bitmask: 0:None,1: Recording Starts at arming and stops at disarming
// @User: Standard

CAM1_RELAY_ON.__field_text:
// @DisplayName: Camera relay ON value
// @Description: This sets whether the relay goes high or low when it triggers. Note that you should also set RELAY_DEFAULT appropriately for your camera
// @Values: 0:Low,1:High
// @User: Standard

CAM1_SERVO_OFF.__field_text:
// @DisplayName: Camera servo OFF PWM value
// @Description: PWM value in microseconds to move servo to when shutter is deactivated
// @Units: PWM
// @Range: 1000 2000
// @User: Standard

CAM1_SERVO_ON.__field_text:
// @DisplayName: Camera servo ON PWM value
// @Description: PWM value in microseconds to move servo to when shutter is activated
// @Units: PWM
// @Range: 1000 2000
// @User: Standard

CAM1_TRIGG_DIST.__field_text:
// @DisplayName: Camera trigger distance
// @Description: Distance in meters between camera triggers. If this value is non-zero then the camera will trigger whenever the position changes by this number of meters regardless of what mode the APM is in. Note that this parameter can also be set in an auto mission using the DO_SET_CAM_TRIGG_DIST command, allowing you to enable/disable the triggering of the camera during the flight.
// @User: Standard
// @Units: m
// @Range: 0 1000

CAM1_TYPE.__field_text:
// @DisplayName: Camera shutter (trigger) type
// @Description: how to trigger the camera to take a picture
// @Values: 0:None, 1:Servo, 2:Relay, 3:GoPro in Solo Gimbal, 4:Mount (Siyi), 5:MAVLink, 6:MAVLinkCamV2, 7:Scripting
// @User: Standard

CAM2_DURATION.__field_text:
// @DisplayName: Camera shutter duration held open
// @Description: Duration in seconds that the camera shutter is held open
// @Units: s
// @Range: 0 5
// @User: Standard

CAM2_FEEDBAK_PIN.__field_text:
// @DisplayName: Camera feedback pin
// @Description: pin number to use for save accurate camera feedback messages. If set to -1 then don't use a pin flag for this, otherwise this is a pin number which if held high after a picture trigger order, will save camera messages when camera really takes a picture. A universal camera hot shoe is needed. The pin should be held high for at least 2 milliseconds for reliable trigger detection.  Some common values are given, but see the Wiki's "GPIOs" page for how to determine the pin number for a given autopilot. See also the CAMx_FEEDBCK_POL option.
// @Values: -1:Disabled,50:AUX1,51:AUX2,52:AUX3,53:AUX4,54:AUX5,55:AUX6
// @User: Standard
// @RebootRequired: True

CAM2_FEEDBAK_POL.__field_text:
// @DisplayName: Camera feedback pin polarity
// @Description: Polarity for feedback pin. If this is 1 then the feedback pin should go high on trigger. If set to 0 then it should go low
// @Values: 0:TriggerLow,1:TriggerHigh
// @User: Standard

CAM2_INTRVAL_MIN.__field_text:
// @DisplayName: Camera minimum time interval between photos
// @Description: Postpone shooting if previous picture was taken less than this many seconds ago
// @Units: s
// @Range: 0 10
// @User: Standard

CAM2_MNT_INST.__field_text:
// @DisplayName: Camera Mount instance
// @Description: Mount instance camera is associated with. 0 means camera and mount have identical instance numbers e.g. camera1 and mount1
// @User: Standard

CAM2_OPTIONS.__field_text:
// @DisplayName: Camera options
// @Description: Camera options bitmask
// @Bitmask: 0:None,1: Recording Starts at arming and stops at disarming
// @User: Standard

CAM2_RELAY_ON.__field_text:
// @DisplayName: Camera relay ON value
// @Description: This sets whether the relay goes high or low when it triggers. Note that you should also set RELAY_DEFAULT appropriately for your camera
// @Values: 0:Low,1:High
// @User: Standard

CAM2_SERVO_OFF.__field_text:
// @DisplayName: Camera servo OFF PWM value
// @Description: PWM value in microseconds to move servo to when shutter is deactivated
// @Units: PWM
// @Range: 1000 2000
// @User: Standard

CAM2_SERVO_ON.__field_text:
// @DisplayName: Camera servo ON PWM value
// @Description: PWM value in microseconds to move servo to when shutter is activated
// @Units: PWM
// @Range: 1000 2000
// @User: Standard

CAM2_TRIGG_DIST.__field_text:
// @DisplayName: Camera trigger distance
// @Description: Distance in meters between camera triggers. If this value is non-zero then the camera will trigger whenever the position changes by this number of meters regardless of what mode the APM is in. Note that this parameter can also be set in an auto mission using the DO_SET_CAM_TRIGG_DIST command, allowing you to enable/disable the triggering of the camera during the flight.
// @User: Standard
// @Units: m
// @Range: 0 1000

CAM2_TYPE.__field_text:
// @DisplayName: Camera shutter (trigger) type
// @Description: how to trigger the camera to take a picture
// @Values: 0:None, 1:Servo, 2:Relay, 3:GoPro in Solo Gimbal, 4:Mount (Siyi), 5:MAVLink, 6:MAVLinkCamV2, 7:Scripting
// @User: Standard

CAM_RC_BTN_DELAY.__field_text:
// @DisplayName: RunCam button delay before allowing further button presses
// @Description: Time it takes for the a RunCam button press to be actived in ms. If this is too short then commands can get out of sync.
// @User: Advanced

CAM_RC_BT_DELAY.__field_text:
// @DisplayName: RunCam boot delay before allowing updates
// @Description: Time it takes for the RunCam to become fully ready in ms. If this is too short then commands can get out of sync.
