LAND_ABORT_DEG.__field_text:
// @DisplayName: Landing auto-abort slope threshold
// @Description: This parameter is used when using a rangefinder during landing for altitude correction from baro drift (RNGFND_LANDING=1) and the altitude correction indicates your actual altitude is higher than the intended slope path. Normally it would pitch down steeply but that can result in a crash with high airspeed so this allows remembering the baro offset and self-abort the landing and come around for another landing with the correct baro offset applied for a perfect slope. An auto-abort go-around will only happen once, next attempt will not auto-abort again. This operation happens entirely automatically in AUTO mode. This value is the delta degrees threshold to trigger the go-around compared to the original slope. Example: if set to 5 deg and the mission planned slope is 15 deg then if the new slope is 21 then it will go-around. Set to 0 to disable. Requires LAND_SLOPE_RCALC > 0.
// @Range: 0 90
// @Units: deg
// @Increment: 0.1
// @User: Advanced

LAND_ABORT_THR.__field_text:
// @DisplayName: Landing abort using throttle
// @Description: Allow a landing abort to trigger with an input throttle >= 90%. This works with or without stick-mixing enabled.
// @Values: 0:Disabled, 1:Enabled
// @User: Advanced

LAND_DISARMDELAY.__field_text:
// @DisplayName: Landing disarm delay
// @Description: After a landing has completed using a LAND waypoint, automatically disarm after this many seconds have passed. Use 0 to not disarm.
// @Units: s
// @Increment: 1
// @Range: 0 127
// @User: Advanced

LAND_FLAP_PERCNT.__field_text:
// @DisplayName: Landing flap percentage
// @Description: The amount of flaps (as a percentage) to apply in the landing approach and flare of an automatic landing
// @Range: 0 100
// @Units: %
// @Increment: 1
// @User: Advanced

LAND_FLARE_AIM.__field_text:
// @DisplayName: Flare aim point adjustment percentage.
// @Description: This parameter controls how much the aim point is moved to allow for the time spent in the flare manoeuvre. When set to 100% the aim point is adjusted on the assumption that the flare sink rate controller instantly achieves the sink rate set by TECS_LAND_SINK. when set to 0%, no aim point adjustment is made. If the plane consistently touches down short of the aim point reduce the parameter and vice verse.
// @Range: 0 100
// @Units: %
// @Increment: 1
// @User: Advanced

LAND_FLARE_ALT.__field_text:
// @DisplayName: Landing flare altitude
// @Description: Altitude in autoland at which to lock heading and flare to the LAND_PITCH_CD pitch. Note that this option is secondary to LAND_FLARE_SEC. For a good landing it preferable that the flare is triggered by LAND_FLARE_SEC.
// @Units: m
// @Range: 0 30
// @Increment: 0.1
// @User: Advanced

LAND_FLARE_SEC.__field_text:
// @DisplayName: Landing flare time
// @Description: Vertical time before landing point at which to lock heading and flare with the motor stopped. This is vertical time, and is calculated based solely on the current height above the ground and the current descent rate.  Set to 0 if you only wish to flare based on altitude (see LAND_FLARE_ALT).
// @Units: s
// @Range: 0 10
// @Increment: 0.1
// @User: Advanced

LAND_OPTIONS.__field_text:
// @DisplayName: Landing options bitmask
// @Description: Bitmask of options to use with landing.
// @Bitmask: 0: honor min throttle during landing flare,1: Increase Target landing airspeed constraint From Trim Airspeed to ARSPD_FBW_MAX
// @User: Advanced

LAND_PF_ALT.__field_text:
// @DisplayName: Landing pre-flare altitude
// @Description: Altitude to trigger pre-flare flight stage where LAND_PF_ARSPD controls airspeed. The pre-flare flight stage trigger works just like LAND_FLARE_ALT but higher. Disabled when LAND_PF_ARSPD is 0.
// @Units: m
// @Range: 0 30
// @Increment: 0.1
// @User: Advanced

LAND_PF_ARSPD.__field_text:
// @DisplayName: Landing pre-flare airspeed
// @Description: Desired airspeed during pre-flare flight stage. This is useful to reduce airspeed just before the flare. Use 0 to disable.
// @Units: m/s
// @Range: 0 30
// @Increment: 0.1
// @User: Advanced

LAND_PF_SEC.__field_text:
// @DisplayName: Landing pre-flare time
// @Description: Vertical time to ground to trigger pre-flare flight stage where LAND_PF_ARSPD controls airspeed. This pre-flare flight stage trigger works just like LAND_FLARE_SEC but earlier. Disabled when LAND_PF_ARSPD is 0.
// @Units: s
// @Range: 0 10
// @Increment: 0.1
// @User: Advanced

LAND_PITCH_CD.__field_text:
// @DisplayName: Landing Pitch
// @Description: Used in autoland to give the minimum pitch in the final stage of landing (after the flare). This parameter can be used to ensure that the final landing attitude is appropriate for the type of undercarriage on the aircraft. Note that it is a minimum pitch only - the landing code will control pitch above this value to try to achieve the configured landing sink rate.
// @Units: cdeg
// @Range: -2000 2000
// @Increment: 10
// @User: Advanced

LAND_SLOPE_RCALC.__field_text:
// @DisplayName: Landing slope re-calc threshold
// @Description: This parameter is used when using a rangefinder during landing for altitude correction from baro drift (RNGFND_LANDING=1) and the altitude correction indicates your altitude is lower than the intended slope path. This value is the threshold of the correction to re-calculate the landing approach slope. Set to zero to keep the original slope all the way down and any detected baro drift will be corrected by pitching/throttling up to snap back to resume the original slope path. Otherwise, when a rangefinder altitude correction exceeds this threshold it will trigger a slope re-calculate to give a shallower slope. This also smoothes out the approach when flying over objects such as trees. Recommend a value of 2m.
// @Range: 0 5
// @Units: m
// @Increment: 0.5
// @User: Advanced

LAND_THEN_NEUTRL.__field_text:
// @DisplayName: Set servos to neutral after landing
// @Description: When enabled, after an autoland and auto-disarm via LAND_DISARMDELAY happens then set all servos to neutral. This is helpful when an aircraft has a rough landing upside down or a crazy angle causing the servos to strain.
// @Values: 0:Disabled, 1:Servos to Neutral, 2:Servos to Zero PWM
// @User: Advanced

LAND_THR_SLEW.__field_text:
// @DisplayName: Landing throttle slew rate
// @Description: This parameter sets the slew rate for the throttle during auto landing. When this is zero the THR_SLEWRATE parameter is used during landing. The value is a percentage throttle change per second, so a value of 20 means to advance the throttle over 5 seconds on landing. Values below 50 are not recommended as it may cause a stall when airspeed is low and you can not throttle up fast enough.
// @Units: %
// @Range: 0 127
// @Increment: 1
// @User: Standard

LAND_TYPE.__field_text:
// @DisplayName: Auto-landing type
// @Description: Specifies the auto-landing type to use
// @Values: 0:Standard Glide Slope, 1:Deepstall
// @User: Standard

LAND_WIND_COMP.__field_text:
// @DisplayName: Headwind Compensation when Landing
// @Description: This param controls how much headwind compensation is used when landing.  Headwind speed component multiplied by this parameter is added to TECS_LAND_ARSPD command.  Set to Zero to disable.  Note:  The target landing airspeed command is still limited to ARSPD_FBW_MAX.
// @Range: 0 100
// @Units: %
// @Increment: 1
// @User: Advanced

LAND_DS_ABORTALT.__field_text:
// @DisplayName: Deepstall minimum abort altitude
// @Description: The minimum altitude which the aircraft must be above to abort a deepstall landing
// @Range: 0 50
// @Units: m
// @User: Advanced

LAND_DS_AIL_SCL.__field_text:
// @DisplayName: Aileron landing gain scalaing
// @Description: A scalar to reduce or increase the aileron control
// @Range: 0 2.0
// @User: Advanced

LAND_DS_APP_EXT.__field_text:
// @DisplayName: Deepstall approach extension
// @Description: The horizontal distance from which the aircraft will approach before the stall
// @Range: 10 200
// @Units: m
// @User: Advanced

LAND_DS_ARSP_MAX.__field_text:
// @DisplayName: Deepstall enabled airspeed
// @Description: The maximum aispeed where the deepstall steering controller is allowed to have control
// @Range: 5 20
// @Units: m/s
// @User: Advanced

LAND_DS_ARSP_MIN.__field_text:
// @DisplayName: Deepstall minimum derating airspeed
// @Description: Deepstall lowest airspeed where the deepstall controller isn't allowed full control
// @Range: 5 20
// @Units: m/s
// @User: Advanced

LAND_DS_ELEV_PWM.__field_text:
// @DisplayName: Deepstall elevator PWM
// @Description: The PWM value in microseconds for the elevator at full deflection in deepstall
// @Range: 900 2100
// @Units: PWM
// @User: Advanced

LAND_DS_L1.__field_text:
// @DisplayName: Deepstall L1 period
// @Description: Deepstall L1 navigational controller period
// @Range: 5 50
// @Units: s
// @User: Advanced

LAND_DS_L1_I.__field_text:
// @DisplayName: Deepstall L1 I gain
// @Description: Deepstall L1 integratior gain
// @Range: 0 1
// @User: Advanced

LAND_DS_L1_TCON.__field_text:
// @DisplayName: Deepstall L1 time constant
// @Description: Time constant for deepstall L1 control
// @Range: 0 1
// @Units: s
// @User: Advanced

LAND_DS_SLEW_SPD.__field_text:
// @DisplayName: Deepstall slew speed
// @Description: The speed at which the elevator slews to deepstall
// @Range: 0 2
// @Units: s
// @User: Advanced

LAND_DS_SLOPE_A.__field_text:
// @DisplayName: Deepstall slope a
// @Description: The a component of distance = a*wind + b
// @User: Advanced

LAND_DS_SLOPE_B.__field_text:
// @DisplayName: Deepstall slope b
// @Description: The a component of distance = a*wind + b
// @User: Advanced

LAND_DS_V_DWN.__field_text:
// @DisplayName: Deepstall velocity down
// @Description: The downward velocity of the aircraft while stalled
// @Range: 0 20
// @Units: m/s
// @User: Advanced

LAND_DS_V_FWD.__field_text:
// @DisplayName: Deepstall forward velocity
// @Description: The forward velocity of the aircraft while stalled
// @Range: 0 20
// @Units: m/s
// @User: Advanced

LAND_DS_YAW_LIM.__field_text:
// @DisplayName: Deepstall yaw rate limit
// @Description: The yaw rate limit while navigating in deepstall
// @Range: 0 90
// @Units: deg/s
// @User: Advanced

LGR_DEPLOY_ALT.__field_text:
// @DisplayName: Landing gear deployment altitude
// @Description: Altitude where the landing gear will be deployed. This should be lower than the RETRACT_ALT. If zero then altitude is not used for deploying landing gear. Only applies when vehicle is armed.
// @Units: m
// @Range: 0 1000
// @Increment: 1
// @User: Standard

LGR_DEPLOY_PIN.__field_text:
// @DisplayName: Chassis deployment feedback pin
// @Description: Pin number to use for detection of gear deployment. If set to -1 feedback is disabled. Some common values are given, but see the Wiki's "GPIOs" page for how to determine the pin number for a given autopilot.
// @Values: -1:Disabled,50:AUX1,51:AUX2,52:AUX3,53:AUX4,54:AUX5,55:AUX6
// @User: Standard
// @RebootRequired: True

LGR_DEPLOY_POL.__field_text:
// @DisplayName: Chassis deployment feedback pin polarity
// @Description: Polarity for feedback pin. If this is 1 then the pin should be high when gear are deployed. If set to 0 then then deployed gear level is low.
// @Values: 0:Low,1:High
// @User: Standard

LGR_ENABLE.__field_text:
// @DisplayName: Enable landing gear
// @Description: Enable landing gear control
// @Values: 0:Disabled, 1:Enabled
// @User: Standard

LGR_OPTIONS.__field_text:
// @DisplayName: Landing gear auto retract/deploy options
// @Description: Options to retract or deploy landing gear in Auto or Guided mode
// @Bitmask: 0:Retract after Takeoff,1:Deploy during Land
// @User: Standard

LGR_RETRACT_ALT.__field_text:
// @DisplayName: Landing gear retract altitude
// @Description: Altitude where the landing gear will be retracted. This should be higher than the DEPLOY_ALT. If zero then altitude is not used for retracting landing gear. Only applies when vehicle is armed.
// @Units: m
// @Range: 0 1000
// @Increment: 1
// @User: Standard

LGR_STARTUP.__field_text:
// @DisplayName: Landing Gear Startup position
// @Description: Landing Gear Startup behaviour control
// @Values: 0:WaitForPilotInput, 1:Retract, 2:Deploy
// @User: Standard

LGR_WOW_PIN.__field_text:
// @DisplayName: Weight on wheels feedback pin
// @Description: Pin number to use for feedback of weight on wheels condition. If set to -1 feedback is disabled. Some common values are given, but see the Wiki's "GPIOs" page for how to determine the pin number for a given autopilot.
// @Values: -1:Disabled,50:AUX1,51:AUX2,52:AUX3,53:AUX4,54:AUX5,55:AUX6
// @User: Standard
// @RebootRequired: True

LGR_WOW_POL.__field_text:
// @DisplayName: Weight on wheels feedback pin polarity
// @Description: Polarity for feedback pin. If this is 1 then the pin should be high when there is weight on wheels. If set to 0 then then weight on wheels level is low.
// @Values: 0:Low,1:High
// @User: Standard

LOG_BACKEND_TYPE.__field_text:
// @DisplayName: AP_Logger Backend Storage type
// @Description: Bitmap of what Logger backend types to enable. Block-based logging is available on SITL and boards with dataflash chips. Multiple backends can be selected.
// @Bitmask: 0:File,1:MAVLink,2:Block
// @User: Standard

LOG_BLK_RATEMAX.__field_text:
// @DisplayName: Maximum logging rate for block backend
// @Description: This sets the maximum rate that streaming log messages will be logged to the block backend. A value of zero means that rate limiting is disabled.
// @Units: Hz
// @Range: 0 1000
// @Increment: 0.1
// @User: Standard

LOG_DARM_RATEMAX.__field_text:
// @DisplayName: Maximum logging rate when disarmed
// @Description: This sets the maximum rate that streaming log messages will be logged to any backend when disarmed. A value of zero means that the normal backend rate limit is applied.
// @Units: Hz
// @Range: 0 1000
// @Increment: 0.1
// @User: Standard

LOG_DISARMED.__field_text:
// @DisplayName: Enable logging while disarmed
// @Description: If LOG_DISARMED is set to 1 then logging will be enabled at all times including when disarmed. Logging before arming can make for very large logfiles but can help a lot when tracking down startup issues and is necessary if logging of EKF replay data is selected via the LOG_REPLAY parameter. If LOG_DISARMED is set to 2, then logging will be enabled when disarmed, but not if a USB connection is detected. This can be used to prevent unwanted data logs being generated when the vehicle is connected via USB for log downloading or parameter changes. If LOG_DISARMED is set to 3 then logging will happen while disarmed, but if the vehicle never arms then the logs using the filesystem backend will be discarded on the next boot.
// @Values: 0:Disabled,1:Enabled,2:Disabled on USB connection,3:Discard log on reboot if never armed
// @User: Standard

LOG_FILE_BUFSIZE.__field_text:
// @DisplayName: Maximum AP_Logger File and Block Backend buffer size (in kilobytes)
// @Description: The File and Block backends use a buffer to store data before writing to the block device.  Raising this value may reduce "gaps" in your SD card logging.  This buffer size may be reduced depending on available memory.  PixHawk requires at least 4 kilobytes.  Maximum value available here is 64 kilobytes.
// @User: Standard

LOG_FILE_DSRMROT.__field_text:
// @DisplayName: Stop logging to current file on disarm
// @Description: When set, the current log file is closed when the vehicle is disarmed.  If LOG_DISARMED is set then a fresh log will be opened. Applies to the File and Block logging backends.
// @Values: 0:Disabled,1:Enabled
// @User: Standard

LOG_FILE_MB_FREE.__field_text:
// @DisplayName: Old logs on the SD card will be deleted to maintain this amount of free space
// @Description: Set this such that the free space is larger than your largest typical flight log
// @Units: MB
// @Range: 10 1000
// @User: Standard

LOG_FILE_RATEMAX.__field_text:
// @DisplayName: Maximum logging rate for file backend
// @Description: This sets the maximum rate that streaming log messages will be logged to the file backend. A value of zero means that rate limiting is disabled.
// @Units: Hz
// @Range: 0 1000
// @Increment: 0.1
// @User: Standard

LOG_FILE_TIMEOUT.__field_text:
// @DisplayName: Timeout before giving up on file writes
// @Description: This controls the amount of time before failing writes to a log file cause the file to be closed and logging stopped.
// @User: Standard
// @Units: s

LOG_MAV_BUFSIZE.__field_text:
// @DisplayName: Maximum AP_Logger MAVLink Backend buffer size
// @Description: Maximum amount of memory to allocate to AP_Logger-over-mavlink
// @User: Advanced
// @Units: kB

LOG_MAV_RATEMAX.__field_text:
// @DisplayName: Maximum logging rate for mavlink backend
// @Description: This sets the maximum rate that streaming log messages will be logged to the mavlink backend. A value of zero means that rate limiting is disabled.
// @Units: Hz
// @Range: 0 1000
// @Increment: 0.1
// @User: Standard

LOG_REPLAY.__field_text:
// @DisplayName: Enable logging of information needed for Replay
// @Description: If LOG_REPLAY is set to 1 then the EKF2 and EKF3 state estimators will log detailed information needed for diagnosing problems with the Kalman filter. LOG_DISARMED must be set to 1 or 2 or else the log will not contain the pre-flight data required for replay testing of the EKF's. It is suggested that you also raise LOG_FILE_BUFSIZE to give more buffer space for logging and use a high quality microSD card to ensure no sensor data is lost.
// @Values: 0:Disabled,1:Enabled
// @User: Standard

MIS_OPTIONS.__field_text:
// @DisplayName: Mission options bitmask
// @Description: Bitmask of what options to use in missions.
// @Bitmask: 0:Clear Mission on reboot, 1:Use distance to land calc on battery failsafe,2:ContinueAfterLand
// @Bitmask{Copter}: 0:Clear Mission on reboot, 2:ContinueAfterLand
// @Bitmask{Rover, Sub}: 0:Clear Mission on reboot
// @User: Advanced

MIS_RESTART.__field_text:
// @DisplayName: Mission Restart when entering Auto mode
// @Description: Controls mission starting point when entering Auto mode (either restart from beginning of mission or resume from last command run)
// @Values: 0:Resume Mission, 1:Restart Mission
// @User: Advanced

MIS_TOTAL.__field_text:
// @DisplayName: Total mission commands
// @Description: The number of mission mission items that has been loaded by the ground station. Do not change this manually.
// @Range: 0 32766
// @Increment: 1
// @User: Advanced
// @ReadOnly: True

MNT1_DEFLT_MODE.__field_text:
// @DisplayName: Mount default operating mode
// @Description: Mount default operating mode on startup and after control is returned from autopilot
// @Values: 0:Retracted,1:Neutral,2:MavLink Targeting,3:RC Targeting,4:GPS Point,5:SysID Target,6:Home Location
// @User: Standard

MNT1_DEVID.__field_text:
// @DisplayName: Mount Device ID
// @Description: Mount device ID, taking into account its type, bus and instance
// @ReadOnly: True
// @User: Advanced

MNT1_LEAD_PTCH.__field_text:
// @DisplayName: Mount Pitch stabilization lead time
// @Description: Servo mount pitch angle output leads the vehicle angle by this amount of time based on current pitch rate. Increase until the servo is responsive but does not overshoot
// @Units: s
// @Range: 0.0 0.2
// @Increment: .005
// @User: Standard

MNT1_LEAD_RLL.__field_text:
// @DisplayName: Mount Roll stabilization lead time
// @Description: Servo mount roll angle output leads the vehicle angle by this amount of time based on current roll rate. Increase until the servo is responsive but does not overshoot
// @Units: s
// @Range: 0.0 0.2
// @Increment: .005
// @User: Standard

MNT1_NEUTRAL_X.__field_text:
// @DisplayName: Mount roll angle when in neutral position
// @Description: Mount roll angle when in neutral position
// @Units: deg
// @Range: -180.0 180.0
// @Increment: 1
